window.bookSummaryJSON = "<p><b>I’ll do anything to get in. I’ll even become theirs.</b></p> <p>Victor. Torsten. Cassius – the jock, the artist, the stepbrother.</p> <p>The Poison Ivy Club.</p> <p>Ruthless.</p> <p>Connected.</p> <p>Violent.</p> <p>Untouchable.</p> <p>They rule Stonehurst Prep with an iron fist.</p> <p>If you want Harvard, Princeton, or Yale, they’ll get you in.</p> <p>Guaranteed.</p> <p>But they’ll take their pound of flesh first.</p> <p>A deal’s a deal – you give them whatever they want, and they’ll make your dreams come true.</p> <p>And they want me.</p> <p>In their beds.</p> <p>On their arms.</p> <p>Part of their gang.</p> <p>I’ll do anything to get into an Ivy League school.</p> <p>I’ll lie. I’ll cheat.</p> <p>I’ll get on my knees.</p> <p>I’ll kill.</p> <p>But those three dark princes will never have my heart.</p> <p><i>This is a new adult, dark contemporary romance with three poisonous guys and one fearless girl. It is intended for 18+ listeners.</i></p>"; 
